import java.io.File;
import java.io.IOException;
import java.util.ArrayList;
import java.util.HashMap;
import java.util.Random;

import javax.imageio.ImageIO;

public class Game {
	ArrayList<Integer> doors = new ArrayList<Integer>();
	ArrayList<Integer> treasures = new ArrayList<Integer>();
	ArrayList<Integer> discards = new ArrayList<Integer>();
	Player p1 = new Player("p1");
	Player p2 = new Player("p2");
	Player currentPlayer = new Player("p1");
	int turnPlayer;
	CardFunc funcs = new CardFunc(this);
	int mInPlay = 0; //0 indicates no monster, otherwise card number goes here.
	int mLevel = 0; //0 indicates no monster, otherwise monster level goes here.
	MFrame mframe;
	
	

	public Game(ArrayList<Integer> doors, ArrayList<Integer> treasures) {
 		this.doors = doors;
		this.treasures = treasures;
		this.turnPlayer=1;
	}
	
	public void changePlayer() {
		if(turnPlayer == 1) {
			currentPlayer = p2;
			turnPlayer = 2;
		} else {
			currentPlayer = p1;
			turnPlayer = 1;
		}
	}
	

	public ArrayList<Integer> shuffle(ArrayList<Integer> cards) {
		Random rand = new Random();
		for (int i = cards.size() - 1; i > 0; i--) {
			int randNum = rand.nextInt(i);
			int temp = cards.get(randNum);
			cards.set(randNum, cards.get(i));
			cards.set(i, temp);
		}
		return cards;
	}
	
	public void setInitialCards(){
		p1.pHand=this.dealCards();
		p2.pHand=this.dealCards();
	}

	
	public ArrayList<Integer> dealCards() {
		ArrayList<Integer> deal = new ArrayList<Integer>();
		doors = shuffle(doors);
		treasures = shuffle(treasures);
		for (int i = 0; i <= 3; i++) {
			deal.add(doors.get(doors.size() - 1));
			deal.add(treasures.get(treasures.size()-1));
			doors.remove(doors.get(doors.size() - 1));
			treasures.remove(treasures.get(treasures.size()-1));
			
		}
		return deal;
	}
	//This function will not deal another card if the player hand size equals 8
	public boolean dealNewCard(ArrayList<Integer> cards, Player p){
		int size = cards.size()-1;
		if(p.pHand.size() < 8) {
			p.pHand.add(cards.get(size));
			try {
				this.mframe.mainPanel.bCardPanel.largeCard = ImageIO.read(new File ("src\\m"+(cards.get(size))+".PNG"));
				this.mframe.mainPanel.bCardPanel.repaint();
			} catch (IOException e) {
				System.out.println("error reading card in GAME");
				e.printStackTrace();
			}
			cards.remove(size);
			return true;
		} return false;
	}
	
	public boolean dealNewCardTest(ArrayList<Integer> cards, Player p){
		int size = cards.size()-1;
		if(p.pHand.size() < 8) {
			p.pHand.add(cards.get(size));
			cards.remove(size);
			return true;
		} return false;
	}
	
	public boolean mustDiscard(Player p) {
		return p.pHand.size()>=8;
	}
	
	public boolean discardCard(Player p, int card) {
		if(p.pHand.contains(card)) {
			p.pHand.remove(p.pHand.indexOf(card));
			discards.add(card);
			return true;
		}return false;
	}
	
	public ArrayList<Integer> returnDiscardPile() {
		return discards;
	}
	
	//num==0 indicates a random value. otherwise, use given value.
	public int rollDice(int num) {
		if(num==0){
			Random rand = new Random();
			return rand.nextInt(6) + 1;
		}
		else{
			return num;
		}
		
	}
	
	public void updateMLevel(int cardToMove){
		InitializeCards ic = new InitializeCards();
		if (cardToMove < 83) { //if the card is a door card being put in play: 
		Card cardInPlay = ic.getCardHash().get(cardToMove);
		if(this.mLevel==0){ //if a monster is in play, don't want to override
								//with another door card.
			//myGame.mInPlay=cardInPlay.num;
			System.out.println(cardToMove);
			this.mLevel = ic.getCardHash().get(cardToMove).monsterLevel;
					
		}
		if (this.mInPlay != 0) {
			//myGame.mLevel = ic.getCardHash().get(cardToMove).monsterLevel+myGame.mLevel;
				
		}
	
	}
	}


}

import java.io.IOException;


public class CardFunc {
	public Game myGame;
	public Player p;
	public CardFunc(Game game){
		this.myGame=game;
		if (myGame.turnPlayer==1){
			p=myGame.p1;
		}
		else{
			p=myGame.p2;
		}
		
	}
	
	public void func1Init() {
		myGame.currentPlayer.cLevel -= 5;
	}
	
	public void func1(boolean checkWin) throws IOException {
		//+5 to Monster
		//If win, draw extra treasure
		if(checkWin) {
			myGame.dealNewCardTest(myGame.treasures, myGame.currentPlayer);
		}
	}
	
	public void func2Init() {
		if(myGame.currentPlayer.className.equals("Monster Whacker")) {
			myGame.currentPlayer.cLevel -= 3;
		}
	}
	
	public void func2(boolean checkWin) {
		if(checkWin) {
			myGame.dealNewCardTest(myGame.treasures, myGame.currentPlayer);
		}else {
			if(!myGame.currentPlayer.className.equals("Cultist")) {
				myGame.currentPlayer.className = "";				
				//Need to discard any class card in play
			}
		}
	}
	
	public void func7Init() {
		if(myGame.currentPlayer.gender == 'F') {
			myGame.currentPlayer.cLevel += 4;
		}
	}
	
	public void func7(boolean checkWin) {
		if(checkWin) {
			myGame.dealNewCardTest(myGame.treasures, myGame.currentPlayer);
		} else {
			//Discard a card in your hand
			myGame.discardCard(myGame.currentPlayer, myGame.currentPlayer.pHand.get(0));
		}
	}
	
	public void func8Init() {
		if(myGame.currentPlayer.pHand.size()%2 == 0) {
			myGame.currentPlayer.cLevel -= 3;
		} 
	}
	
	public void func8(boolean checkWin) {
		if(checkWin) {
			myGame.dealNewCardTest(myGame.treasures, myGame.currentPlayer);
			myGame.dealNewCardTest(myGame.treasures, myGame.currentPlayer);
		}
	}
	
	public void end(){
		if(myGame.turnPlayer==1){
			myGame.p1=p;
		}
		else{
			myGame.p2=p;
		}
	}

}

import java.util.HashMap;

public class Card {
	public String NotUsableBy = "";
	public int num;
	public String name;
	public int addNum;
	public int monsterLevel=0; //is 0 if not a monster
	public String badStuff=""; //gold or treas or level or items
	public int badGold;
	public int badTreas;
	public int badLevel;
	public int badItems;
	public int numTreas;
	public int monsterLevelBonus = 0; //always execute
	public int monsterLevelCondBonus; //only execute if certain condition is met
	public String condForBonus;
	public boolean inPlay;
	public int numGold;
	public int numHands;
	public boolean footGear;
	public boolean headGear;
	public int pLevelBonus=0;
	public boolean goUpALevel;
	public boolean forMe;
	public int numUse;
	public int bonusTreasure=0;
	boolean readyToPlay=false; //means card is implemented enough to be in demo.
	public int selfOrOther; //1 for other
	public boolean armor;
	public boolean discard=true; //true means discard at end of combat. false means keep.
	
	
	
	
	public Card(int num, String name) {
		this.num = num;
		this.name = name;
		
		
			
	}
	
	public String getName(){
		return this.name;
	}
	
	public int getNumber(){
		return this.num;
	}

}
